import React from 'react';
import '../styles/que.css';

function QuedVideos({vidArr}) {

    console.log(vidObj[4])
    return (
        <div className="queue">
            {vidObj.map((obj)=>{
                return (
                    <img src = {obj.thumbnail}/>
                )
            })
            }
        </div>
    );
}

export default QuedVideos;
